import logo from './logo.svg';
import './App.css';
import {useState} from 'react';
function App() {
  const [age, setAge] = useState(true);
  return (
    <div className="App">
      {age ? <h1>(age)</h1>:<h1>(false)</h1>}
    </div>
  );
}

export default App;
